        color: $color3;
        padding: 46px;
        -webkit-box-shadow: 0px 0px 74px 17px rgba(0, 0, 0, 0.34);
        -moz-box-shadow: 0px 0px 74px 17px rgba(0, 0, 0, 0.34);
        box-shadow: 0px 0px 74px 17px rgba(0, 0, 0, 0.34);
        overflow-y: scroll;
        overflow-x: hidden;

        h4 {
          margin-top: 2rem;
          font-size: 1.3rem;
          margin-bottom: 4rem;
          font-weight: 500;
        }

        input[type="text"],
        input[type="email"],
        textarea {
          width: 100%;
          background: transparent;
          border: none;
          border-bottom: 2px solid $color5;
          margin-bottom: 2rem;
          font-size: 0.9rem;
          text-transform: uppercase;
          line-height: 1.2;
          color: $color5;
          padding: 15px 0;
        }

        button[type="submit"] {
          background: $color1;
          border: none;
          font-size: 1.1rem;
          color: white;
          width: 100%;
          text-decoration: none;
          text-transform: uppercase;
          padding: 17px 30px;
          border-radius: 30px;
          text-align: center;
          -webkit-border-radius: 30px;
          -moz-border-radius: 30px;
        }
      }
    }
    .contact-section {
      vertical-align: top;
      display: inline-block;
      width: 70%;
      float: right;
      padding: 56px 0 0;

      .contact-info {
        .contact-box {
          max-width: 550px;

          padding: 30px;
          transition: all 0.3s ease-in-out;
          cursor: pointer;
          &:hover {
            -webkit-box-shadow: 0px 20px 74px 17px rgba(0, 0, 0, 0.12);
            -moz-box-shadow: 0px 20px 74px 17px rgba(0, 0, 0, 0.12);
            box-shadow: 0px 20px 74px 17px rgba(0, 0, 0, 0.12);
          }
          h5 {
            font-weight: 600;
            font-size: 1.1rem;
            margin: 0 0 1.5rem;
          }
          p {
            color: $color5;
            font-weight: 300;
            line-height: 1.4;
            margin: 0 0 2rem;
          }
        }
        h1 {
          font-size: 2.3rem;
          font-weight: 500;
          line-height: 1.2;
          margin: 0 0 1rem;
          span {
            color: $color1;
          }
        }
      }
    }
  }
}

sources.scss/main.scss:
@import "reset.scss";
@import "variable";
@import "infoSection";
@import "home";
@import "resume";
@import "work";
@import "contact";

* {
  box-sizing: border-box;
}

html,
body {
  background: $color1;
  font-size: 18px;
  font-family: "Roboto Mono", monospace;
  height: 100%;
}

.menu-icon {
  position: fixed;
  right: 36px;
  top: 36px;
  padding: 20px;
  z-index: 11;
  cursor: pointer;
  .fa-solid {
    font-size: 2rem;
    color: $color1;
  }
}

.primary-btn {
  background: $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color3;
  padding: 15px 30px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  margin-right: 15px;
  text-decoration: none;
  transition: all .3s ease-in-out;
  &:hover {
    background: black;
    color: $color3;

  }
}

.ghost-btn {
    text-decoration: none;
  border: 4px solid $color1;
  -webkit-border-radius: 30px;
  -moz-border-radius: 30px;
  border-radius: 30px;
  text-align: center;
  color: $color1;
  padding: 12px 27px;
  display: inline-block;
  text-transform: uppercase;
  letter-spacing: 3px;
  transition: all .3s ease-in-out;
  &:hover {
    border-color: $hoverColor;
  }
}


  #menu {
    background: $color1;
    position: fixed;
    width: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(-100%, 0,0);
    z-index: 10;
    display: flex;
    align-items: center;
    justify-content: center;
    opacity: 1;
    transition: all 0.5s ease-in-out;

    nav {
      width: 400px;
      text-align: center;
      a {
        display: block;
        font-size: 2.3rem;
        padding: 1rem;
        text-decoration: none;
        color: white;
        &:hover {
          color: $color5;
        }
      }
    }
  }


.menu-active {
  #menu {
    width: 100%;
    height: 100%;
    top: 0;
    bottom: 0;
    transform: translate3d(200px, 0,0);
  }

  .menu-icon {
    .fa {
        color: white
    }
  }
}

.scroll-section {
  height: 100vh;
  overflow-y: scroll;
  overflow-x: hidden;
  padding: 56px;
}
